import React from 'react';
import { NavLink } from 'react-router-dom';

import './NavLinks.css';

const Navlinks = (props) => {
  return (
    <ul className="nav-links" onClick={props.onClick}>
      <li>
        <NavLink to="/" exact>
          ALL PLAYERS
        </NavLink>
      </li>
      <li>
        <NavLink to="/players/new" exact>
          ADD PLAYER
        </NavLink>
      </li>
      <li>
        <NavLink to="/auth" exact>
          AUTHENTICATE
        </NavLink>
      </li>
    </ul>
  );
};

export default Navlinks;
